public void run()
{
    QueryBuildRange         range;
    QueryBuildDataSource    qbds;
    VendRequestCompany      vendRequestCompany;

    if (this.args().lookupField() == fieldNum(VendRequestCompany, RecId)
        && this.args().lookupValue() != '')
    {
        select firstOnly VendRequestCompanyType from vendRequestCompany
            where vendRequestCompany.RecId == str2int64(this.args().lookupValue());
    }
    else if (this.args().lookupRecord().RecId)
    {
        vendRequestCompany = this.args().lookupRecord();
    }

    if (vendRequestCompany.VendRequestCompanyType == VendRequestCompanyType::NewVendorCompanyProfile)
    {
        qbds = vendRequest_DS.query().dataSourceTable(tableNum(VendRequest));
        qbds.clearRange(fieldNum(VendRequestCompany, VendRequestCompanyType));
        range = qbds.addRange(fieldNum(VendRequestCompany, VendRequestCompanyType));
        range.value(queryValue(VendRequestCompanyType::NewVendorCompanyProfile));
    }

    super();
}

public int active()
{
    int ret;

    boolean userTabPageVisible = vendRequest_VendRequestCompany.VendRequestCompanyStatus != VendRequestCompanyStatus::Draft
        && vendRequest_VendRequestCompany.VendRequestCompanyStatus != VendRequestCompanyStatus::RequestSubmitted
        && vendRequest_VendRequestCompany.VendRequestCompanyStatus != VendRequestCompanyStatus::RequestPendingApproval
        && vendRequest_VendRequestCompany.VendRequestCompanyStatus != VendRequestCompanyStatus::RequestApproved;

    ret = super();

    vendPostalAddressView_DS.updateButtons();
    contactPostalAddressView_DS.updateButtons();
    vendElectronicAddressView_DS.updateButtons();
    contactElectronicAddressView_DS.updateButtons();

    VendRequestDuplicateCheck::checkVendorAddRequest(vendRequest_VendRequestCompany);

    return ret;
}

